"use strict";(self.webpackChunklearn=self.webpackChunklearn||[]).push([[919],{1004:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"2022-22-09-weeklyCall.md","metadata":{"permalink":"/Learn/blog/2022-22-09-weeklyCall.md","editUrl":"https://github.com/accomdemy/Learn/blog/2022-07-22-weeklyCall.md","source":"@site/blog/2022-07-22-weeklyCall.md","title":"July 22nd Learn Call","description":"The Weekly call started with introduction of members.","date":"2022-07-22T00:00:00.000Z","formattedDate":"July 22, 2022","tags":[{"label":"Weekly call","permalink":"/Learn/blog/tags/weekly-call"},{"label":"Community","permalink":"/Learn/blog/tags/community"}],"readingTime":0.54,"truncated":false,"authors":[{"name":"Salman Faris","title":"Community Member","url":"https://github.com/salmanfarisvp","imageURL":"https://avatars.githubusercontent.com/u/11945360?s=400&u=bd1276417a3266f04915764349ef786a953efa17&v=4","key":"Salman"}],"frontMatter":{"slug":"2022-22-09-weeklyCall.md","title":"July 22nd Learn Call","authors":["Salman"],"tags":["Weekly call","Community"]},"nextItem":{"title":"July 9th Weekly Call","permalink":"/Learn/blog/2022-07-09-weeklyCall.md"}},"content":"The Weekly call started with introduction of members. \\n\\n![GroupPhoto](https://cdn.discordapp.com/attachments/975360084815253526/1000274174486515762/unknown.png)\\n\\nWe discussed various topics, including Paul\'s \\"building nuclear fusion?\\" thread on the #random channel. And I also found one related video from Youtube randomly [Why Private Billions Are Flowing Into Fusion]( https://www.youtube.com/watch?v=Dp6W7g9no0w). It was an excellent documentary, explaining the possibility and needs of fusion energy. \\n\\n\\nThen we discussed the Node-RED platform and the ease of making complex with them. Zain shared about \'node\' that can do computer vision. It was the \\"[node-red-contrib-model-asset-exchange](https://flows.nodered.org/node/node-red-contrib-model-asset-exchange)\\"\\n\\nParticipants \\n* \\n* Paul \\n* Muhammed Zain \\n* Salman Faris \\n* Vincent\\n* jacky.dev\\n\\n\\nResource Shared  \\n* [Why Private Billions Are Flowing Into Fusion]( https://www.youtube.com/watch?v=Dp6W7g9no0w)\\n* [node-red-contrib-model-asset-exchange](https://flows.nodered.org/node/node-red-contrib-model-asset-exchange)"},{"id":"2022-07-09-weeklyCall.md","metadata":{"permalink":"/Learn/blog/2022-07-09-weeklyCall.md","editUrl":"https://github.com/accomdemy/Learn/blog/2022-07-09-weeklyCall.md","source":"@site/blog/2022-07-09-weeklyCall.md","title":"July 9th Weekly Call","description":"The Weekly call started by getting to know the ESP-C3 Dev module from DFRobot, and we had great discussions on LoRa, Thread and Matter protocols.","date":"2022-07-09T00:00:00.000Z","formattedDate":"July 9, 2022","tags":[{"label":"Weekly call","permalink":"/Learn/blog/tags/weekly-call"},{"label":"Community","permalink":"/Learn/blog/tags/community"}],"readingTime":0.755,"truncated":false,"authors":[{"name":"Salman Faris","title":"Community Member","url":"https://github.com/salmanfarisvp","imageURL":"https://avatars.githubusercontent.com/u/11945360?s=400&u=bd1276417a3266f04915764349ef786a953efa17&v=4","key":"Salman"}],"frontMatter":{"slug":"2022-07-09-weeklyCall.md","title":"July 9th Weekly Call","authors":["Salman"],"tags":["Weekly call","Community"]},"prevItem":{"title":"July 22nd Learn Call","permalink":"/Learn/blog/2022-22-09-weeklyCall.md"}},"content":"The Weekly call started by getting to know the [ESP-C3 Dev module from DFRobot](https://www.dfrobot.com/product-2566.html), and we had great discussions on LoRa, Thread and Matter protocols. \\n\\n![Group Image](https://pbs.twimg.com/media/FXNM-qtUsAAFWIj?format=jpg&name=large)\\n\\nMuhammed Zain Shared his [wild fire prediction project](https://zainmfd.github.io/FightFire/), which uses LoRa radio communication methods to transfer the information and [LoCom](https://www.youtube.com/watch?v=-hIDE8acqhQ&feature=youtu.be), That is build for remote communities for emergency communication. \\n![wild fire prediction project](https://zainmfd.github.io/FightFire/img/28.jpg), and Travis shared a project called [One Planet Education](https://www.oneplaneteducation.com/) where the LoCom project can be helpful and shared a similer project called [Off-grid LoRa Communicator](https://hackaday.io/project/183966-off-grid-lora-communicator) that similar to LoCom. \\n\\nTravis then shared about the [open thread project](https://openthread.io/) and [maker youtube channel](https://www.youtube.com/c/ThatProject), and that led the discussion to [ESP-NOW Protocol](https://www.youtube.com/watch?v=QmvMtgNs9r8)\\n\\nParticipants \\n* Akid \\n* Travis \\n* Paul \\n* Muhammed Zain \\n* Salman Faris \\n* Vincent\\n* Gray Hat Guy LLC\\n\\nResource Shared \\n* https://www.dfrobot.com/product-2566.html\\n* https://zainmfd.github.io/FightFire/   \\n* https://www.youtube.com/c/ThatProject  \\n* https://github.com/seemoo-lab/openhaystack \\n* https://www.haystacktechnologies.com/haystack-for-lora/\\n* https://www.youtube.com/watch?v=QmvMtgNs9r8\\n* http://oneplaneteducation.com/\\n* https://youtu.be/-hIDE8acqhQ \\n* https://hackaday.io/project/183966-off-grid-lora-communicator \\n* https://www.flux.ai/p"}]}')}}]);